define('text!components/views/server-info/server-info.html', ['module'], function(module) { module.exports = "<template><div class=\"row\"><div class=\"small-6 column\">Server battleeye info here</div><div class=\"small-6 column\"><p>Our server is not for the weak of heart. We are all in it to have fun, sometimes that includes getting killed, losing all your stuff, and having to walk 5km to a trader, and dying on the way. That's all part of the fun.</p><p>However, while we understand the above, we also realize that sometimes Arma can destroy everything you've worked for. Far more efficiently than the friends and foes you face in our server. When that happens we are happy to help, within reason.</p><p>If you follow the rules below and play with sportsmanship than we will all have great time. If you can't do that, then you will be banned.</p><ul><li>No glitching, hacking, or anything outside normal game abilities, under any circumstances. If someone kills you, cheats you, glitches in to your base, this rule STILL applies. Report them to the admins.</li><li>Safe Zone Rules:<ul><li>No killing in the safe zone.</li><li>No retreating into the safe zone under fire. If you are able to strategically retreat into the safe zone cool.</li><li>No stealing vehicles or gear in the safe zone. If someone dies in the safe zone no looting.</li></ul></li><li>No bases within TBA of safe zones.</li><li>Other TBA rules.</li></ul></div></div></template>"; });
